window.bookSummaryJSON = "<p><i>Arise</i>! Once dubbed the Weakest Hunter of All Mankind, Jinwoo is now...well, something else entirely. Armed with his mysterious system, he’s currently powerful enough to single-handedly clear dungeons that once would have proven life-threatening. He just has to ready himself to take on the Demon’s Castle - and what better way to do so than finishing a quest? Exclusive new weapons and skills from an assassin-class job may be just what Jinwoo needs...but the system seems to have other plans for him!</p>"; 
